import React from "react";
import "./ChartBar.css";
const ChartBar = (props) => {
  return (
    <div>
      <div className="ChartBar">
        <div className="chart-bar__inner">
          <div className="chart-bar__fill">
            <br></br>
          </div>
          <div className="chart-bar__label">{props.month}</div>
        </div>
        
      </div>
    </div>
  );
};

export default ChartBar;
